import React from 'react'
import './Subtotal.css';
import CurrencyFormat from 'react-currency-format';

function Subtotal() {
    return (
        <div className="subtotal">
            <CurrencyFormat 
                renderText={
                <>
                    <p>Sub</p>
                </>
                }
            />
        </div>
    )
}

export default Subtotal
